package pt.com.everis.academia.java;

public class Unario {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int result = +1;
		System.out.println(result);
		
		result--;
		System.out.println(result);
		
		result++;
		System.out.println(result);
		
		result = -result;
		
		System.out.println(result);
		
		boolean sucess = false;
		
		System.out.println(sucess);
		
		System.out.println(!sucess);

	}

}
